const NewspaperBlog = () => {
    return (
        <div className="container">
            <h1 className="d-flex justify-content-center">This is the newspaper blog project!</h1>
            <p>It's not just a blog... So, why not have some fun with it?</p>
        </div>
    );
};

export default NewspaperBlog;
